import React from "react";
import styled from "styled-components";

const BodyContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  height: auto;
`;

const Body = () => {
  return <BodyContainer id="your-body" />;
};

export default Body;
